&quot;Remember when computers were invented? If not, this mind-blowing graphic novel will certainly remind you. All digitally rendered circa 1986-7, it achieves everything today's digital nostalgists are trying to do, but better, and with Iron Man for heaven's sake! Unmissable as contemporary art.&quot;

&quot;Mike Saenz (b. 3 December 1959,[1] in Chicago, Illinois) is a comic book artist and software designer. He is the creator of Shatter.&quot;
